/* For page Planned task*/
/*contains
earlier ,today ,later
*/
import React from "react";
import "../CSS/planned.css";
import "../App.css";
import { Task } from "../components/task.tsx";

export function Planned() {
  const plannedIcon = require("../Images/sidebar-box.png");

  const taskObj = {
    name: "UIUX Course",
    dueDate: new Date(),
    important: false,
    repeat: true,
    completed: true,
    taskID: "1",
  };

  return (
    <div className="planned">
      <div className="planned-heading">
        <img src={plannedIcon} alt="planned"></img>
        <div>Planned</div>
      </div>
      <div className="planned-today">
        <div>Today</div>
        <div>
          <Task {...taskObj} />
        </div>
      </div>
      <div></div>
      <div></div>
    </div>
  );
}
